{"language":"Solidity","sources":{"contracts/KYC.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.25 <0.9.0;

import "./Customers.sol";
import "./Banks.sol";
contract KYC is Customers, Banks {
    address admin;
    address[] internal userList;

    mapping(address => Types.User) internal users;
    mapping(string => Types.KycRequest) internal kycRequests;
    mapping(address => address[]) internal bankCustomers; // All customers associated to a Bank
    mapping(address => address[]) internal customerbanks; // All banks associated to a Customer

    constructor(string memory name_, string memory email_) {
        admin = msg.sender;
        Types.User memory usr_ = Types.User({
            name: name_,
            email: email_,
            id_: admin,
            role: Types.Role.Admin,
            status: Types.BankStatus.Active
        });
        users[admin] = usr_;
        userList.push(admin);
    }

    modifier isAdmin() {
        require(msg.sender == admin, "Only admin is allowed");
        _;
    }

    function kycRequestExists(string memory reqId_)
        internal
        view
        returns (bool)
    {
        require(!Helpers.compareStrings(reqId_, ""), "Request Id empty");
        return Helpers.compareStrings(kycRequests[reqId_].id_, reqId_);
    }

    function getKYCRequests(uint256 pageNumber, bool isForBank)
        internal
        view
        returns (uint256 totalPages, Types.KycRequest[] memory)
    {
        require(pageNumber > 0, "PN should be > zero");
        (
            uint256 pages,
            uint256 pageLength_,
            uint256 startIndex_,
            uint256 endIndex_
        ) = Helpers.getIndexes(
                pageNumber,
                isForBank
                    ? bankCustomers[msg.sender]
                    : customerbanks[msg.sender]
            );
        Types.KycRequest[] memory list_ = new Types.KycRequest[](pageLength_);
        for (uint256 i = startIndex_; i < endIndex_; i++)
            list_[i] = isForBank
                ? kycRequests[
                    Helpers.append(msg.sender, bankCustomers[msg.sender][i])
                ]
                : kycRequests[
                    Helpers.append(customerbanks[msg.sender][i], msg.sender)
                ];
        return (pages, list_);
    }

    event KycRequestAdded(string reqId, string bankName, string customerName);
    event KycReRequested(string reqId, string bankName, string customerName);
    event KycStatusChanged(
        string reqId,
        address customerId,
        address bankId,
        Types.KycStatus status
    );
    event DataHashPermissionChanged(
        string reqId,
        address customerId,
        address bankId,
        Types.DataHashStatus status
    );
  
    function getAllBanks(uint256 pageNumber)
        public
        view
        isAdmin
        returns (uint256 totalPages, Types.Bank[] memory)
    {
        return getallbanks(pageNumber);
    }

    function addBank(Types.Bank memory bank_) public isAdmin {
        addbank(bank_);
        // Adding to common list
        users[bank_.id_] = Types.User({
            name: bank_.name,
            email: bank_.email,
            id_: bank_.id_,
            role: Types.Role.Bank,
            status: Types.BankStatus.Active
        });
        userList.push(bank_.id_);
    }

    function updateBankDetails(
        address id_,
        string memory email_,
        string memory name_
    ) public isAdmin {
        updatebank(id_, email_, name_);
        // Updating in common list
        users[id_].name = name_;
        users[id_].email = email_;
    }

    function activateDeactivateBank(address id_, bool makeActive_)
        public
        isAdmin
    {
        // Updating in common list
        users[id_].status = activatedeactivatebank(id_, makeActive_);
    }

    function getCustomersOfBank(uint256 pageNumber)
        public
        view
        isValidBank(msg.sender)
        returns (uint256 totalPages, Types.KycRequest[] memory)
    {
        return getKYCRequests(pageNumber, true);
    }

    /**
     * @notice Records new KYC request for a customer
     * @param customer_ Customer details for whom the request is to be raised
     * @param currentTime_ Current Date & Time in unix epoch timestamp
     * @param notes_ Any additional notes that need to be added
     */
    function addKycRequest(
        Types.Customer memory customer_,
        uint256 currentTime_,
        string memory notes_
    ) public isValidBank(msg.sender) {
        string memory reqId_ = Helpers.append(msg.sender, customer_.id_);
        require(!kycRequestExists(reqId_), "User had kyc req.");

        kycRequests[reqId_] = Types.KycRequest({
            id_: reqId_,
            userId_: customer_.id_,
            customerName: customer_.name,
            bankId_: msg.sender,
            bankName: getsinglebank(msg.sender).name,
            dataHash: customer_.dataHash,
            updatedOn: currentTime_,
            status: Types.KycStatus.Pending,
            dataRequest: Types.DataHashStatus.Pending,
            additionalNotes: notes_
        });
        bankCustomers[msg.sender].push(customer_.id_);
        customerbanks[customer_.id_].push(msg.sender);
        emit KycRequestAdded(
            reqId_,
            kycRequests[reqId_].bankName,
            customer_.name
        );

        if (!customerExists(customer_.id_)) {
            addcustomer(customer_);
            // Adding to common list
            users[customer_.id_] = Types.User({
                name: customer_.name,
                email: customer_.email,
                id_: customer_.id_,
                role: Types.Role.Customer,
                status: Types.BankStatus.Active
            });
            userList.push(customer_.id_);
        }
    }

    function reRequestForKycRequest(address id_, string memory notes_)
        public
        isValidBank(msg.sender)
    {
        string memory reqId_ = Helpers.append(msg.sender, id_);
        require(kycRequestExists(reqId_), "KYC req not found");
        require(customerExists(id_), "User not found");

        // kycRequests[reqId_].status = Types.KycStatus.Pending;
        kycRequests[reqId_].dataRequest = Types.DataHashStatus.Pending;
        kycRequests[reqId_].additionalNotes = notes_;

        emit KycReRequested(
            reqId_,
            kycRequests[reqId_].bankName,
            kycRequests[reqId_].customerName
        );
    }

    function updateKycVerification(
        address userId_,
        bool verified_,
        string memory note_
    ) public isValidBank(msg.sender) {
        string memory reqId_ = Helpers.append(msg.sender, userId_);
        require(kycRequestExists(reqId_), "User doesn't have KYC req");

        Types.KycStatus status_ = Types.KycStatus.Pending;
        if (verified_) {
            status_ = Types.KycStatus.KYCVerified;
            updatekyccount(msg.sender);
            updatekycdoneby(userId_);
        } else {
            status_ = Types.KycStatus.KYCFailed;
        }

        kycRequests[reqId_].status = status_;
        kycRequests[reqId_].additionalNotes = note_;
        emit KycStatusChanged(reqId_, userId_, msg.sender, status_);
    }

    function searchCustomers(address id_)
        public
        view
        isValidCustomer(id_)
        isValidBank(msg.sender)
        returns (
            bool,
            Types.Customer memory,
            Types.KycRequest memory
        )
    {
        bool found_;
        Types.Customer memory customer_;
        Types.KycRequest memory request_;
        (found_, customer_) = searchcustomers(id_, bankCustomers[msg.sender]);
        if (found_) request_ = kycRequests[Helpers.append(msg.sender, id_)];
        return (found_, customer_, request_);
    }

    function getBankRequests(uint256 pageNumber)
        public
        view
        isValidCustomer(msg.sender)
        returns (uint256 totalPages, Types.KycRequest[] memory)
    {
        return getKYCRequests(pageNumber, false);
    }

    function actionOnKycRequest(
        address bankId_,
        bool approve_,
        string memory note_
    ) public isValidCustomer(msg.sender) isValidBank(bankId_) {
        string memory reqId_ = Helpers.append(bankId_, msg.sender);
        require(kycRequestExists(reqId_), "User doesn't have KYC req");

        Types.DataHashStatus status_ = Types.DataHashStatus.Pending;
        if (approve_) {
            status_ = Types.DataHashStatus.Approved;
        } else {
            status_ = Types.DataHashStatus.Rejected;
        }
        kycRequests[reqId_].dataRequest = status_;
        kycRequests[reqId_].additionalNotes = note_;

        emit DataHashPermissionChanged(reqId_, msg.sender, bankId_, status_);
    }

    function updateProfile(
        string memory name_,
        string memory email_,
        uint256 mobile_
    ) public isValidCustomer(msg.sender) {
        updateprofile(name_, email_, mobile_);
        // Updating in common list
        users[msg.sender].name = name_;
        users[msg.sender].email = email_;
    }

    /**
     * @dev Updates the Datahash of the documents
     * @param hash_ Data hash value that need to be updated
     * @param currentTime_ Current Date Time in unix epoch timestamp
     */
    function updateDatahash(string memory hash_, uint256 currentTime_)
        public
        isValidCustomer(msg.sender)
    {
        updatedatahash(hash_, currentTime_);

        // Reset KYC verification status for all banks
        address[] memory banksList_ = customerbanks[msg.sender];
        for (uint256 i = 0; i < banksList_.length; i++) {
            string memory reqId_ = Helpers.append(banksList_[i], msg.sender);
            if (kycRequestExists(reqId_)) {
                kycRequests[reqId_].dataHash = hash_;
                kycRequests[reqId_].updatedOn = currentTime_;
                kycRequests[reqId_].status = Types.KycStatus.Pending;
                kycRequests[reqId_].additionalNotes = "Updated all my docs";
            }
        }
    }

    function removerDatahashPermission(address bankId_, string memory notes_)
        public
        isValidCustomer(msg.sender)
    {
        string memory reqId_ = Helpers.append(bankId_, msg.sender);
        require(kycRequestExists(reqId_), "Permission not found");
        kycRequests[reqId_].dataRequest = Types.DataHashStatus.Rejected;
        kycRequests[reqId_].additionalNotes = notes_;
        emit DataHashPermissionChanged(
            reqId_,
            msg.sender,
            bankId_,
            Types.DataHashStatus.Rejected
        );
    }

    function searchBanks(address bankId_)
        public
        view
        isValidCustomer(msg.sender)
        isValidBank(bankId_)
        returns (
            bool,
            Types.Bank memory,
            Types.KycRequest memory
        )
    {
        bool found_;
        Types.Bank memory bank_;
        Types.KycRequest memory request_;
        address[] memory banks_ = customerbanks[msg.sender];

        for (uint256 i = 0; i < banks_.length; i++) {
            if (banks_[i] == bankId_) {
                found_ = true;
                bank_ = getsinglebank(bankId_);
                request_ = kycRequests[Helpers.append(bankId_, msg.sender)];
                break;
            }
        }
        return (found_, bank_, request_);
    }

    function whoAmI() public view returns (Types.User memory) {
        require(msg.sender != address(0), "Sender Id Empty");
        require(users[msg.sender].id_ != address(0), "User Id Empty");
        return users[msg.sender];
    }

    function getCustomerDetails(address id_)
        public
        view
        isValidCustomer(id_)
        returns (Types.Customer memory)
    {
        return getcustomerdetails(id_);
    }

    function getBankDetails(address id_)
        public
        view
        isValidBank(id_)
        returns (Types.Bank memory)
    {
        return getsinglebank(id_);
    }
}
"},"contracts/Banks.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma experimental ABIEncoderV2;
pragma solidity >=0.4.25 <0.9.0;

import "./Types.sol";
import "./Helpers.sol";

/**
 * @title Banks
 * @author Suresh Konakanchi
 * @dev Library for managing all finanicial institutions thata were involved in the KYC process
 */
contract Banks {
    address[] internal bankList;
    mapping(address => Types.Bank) internal banks;

    // Events

    event BankAdded(address id_, string name, string email, string ifscCode);
    event BankUpdated(address id_, string name, string email);
    event BankActivated(address id_, string name);
    event BankDeactivated(address id_, string name);

    // Modifiers

    /**
     * @notice Checks whether the requestor is bank & is active
     * @param id_ Metamask address of the bank
     */
    modifier isValidBank(address id_) {
        require(banks[id_].id_ != address(0), "Bank not found");
        require(banks[id_].id_ == id_, "Bank not found");
        require(
            banks[id_].status == Types.BankStatus.Active,
            "Bank is not active"
        );
        _;
    }

    // Contract Methods

    /**
     * @dev All the banks list. Data will be sent in pages to avoid the more gas fee
     * @param pageNumber page number for which data is needed (1..2..3....n)
     * @return totalPages Total pages available
     * @return Bank[] List of banks in the current page
     */
    function getallbanks(uint256 pageNumber)
        internal
        view
        returns (uint256 totalPages, Types.Bank[] memory)
    {
        require(pageNumber > 0, "PN should be > 0");
        (
            uint256 pages,
            uint256 pageLength_,
            uint256 startIndex_,
            uint256 endIndex_
        ) = Helpers.getIndexes(pageNumber, bankList);

        Types.Bank[] memory banksList_ = new Types.Bank[](pageLength_);
        for (uint256 i = startIndex_; i < endIndex_; i++)
            banksList_[i] = banks[bankList[i]];
        return (pages, banksList_);
    }

    /**
     * @dev To get details of the single bank
     * @param id_ metamask address of the requested bank
     * @return Bank Details of the bank
     */
    function getsinglebank(address id_)
        internal
        view
        returns (Types.Bank memory)
    {
        require(id_ != address(0), "Bank Id Empty");
        return banks[id_];
    }

    /**
     * @dev To add new bank account
     * @param bank_ Bank details, which need to be added to the system
     */
    function addbank(Types.Bank memory bank_) internal {
        require(banks[bank_.id_].id_ == address(0), "Bank exists");

        banks[bank_.id_] = bank_;
        bankList.push(bank_.id_);
        emit BankAdded(bank_.id_, bank_.name, bank_.email, bank_.ifscCode);
    }

    /**
     * @dev To add new bank account
     * @param id_ Bank's metamask address
     * @param email_ Bank's email address that need to be updated
     * @param name_ Bank's name which need to be updated
     */
    function updatebank(
        address id_,
        string memory email_,
        string memory name_
    ) internal {
        require(banks[id_].id_ != address(0), "Bank not found");

        banks[id_].name = name_;
        banks[id_].email = email_;
        emit BankUpdated(id_, name_, email_);
    }

    /**
     * @dev To add new bank account
     * @param id_ Bank's metamask address
     * @param makeActive_ If true, bank will be marked as active, else, it will be marked as deactivateds
     * @return BankStatus current status of the bank to update in common list
     */
    function activatedeactivatebank(address id_, bool makeActive_)
        internal
        returns (Types.BankStatus)
    {
        require(banks[id_].id_ != address(0), "Bank not found");

        if (makeActive_ && banks[id_].status == Types.BankStatus.Inactive) {
            banks[id_].status = Types.BankStatus.Active;
            emit BankActivated(id_, banks[id_].name);

            // Updating in common list
            return Types.BankStatus.Active;
        } else if (
            !makeActive_ && banks[id_].status == Types.BankStatus.Active
        ) {
            banks[id_].status = Types.BankStatus.Inactive;
            emit BankDeactivated(id_, banks[id_].name);

            // Updating in common list
            return Types.BankStatus.Inactive;
        } else {
            // Already upto date
            return banks[id_].status;
        }
    }

    /**
     * @dev To update the kyc count that bank did
     * @param id_ Bank's metamask address
     */
    function updatekyccount(address id_) internal {
        require(id_ != address(0), "Bank not found");
        banks[id_].kycCount++;
    }
}
"},"contracts/Customers.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma experimental ABIEncoderV2;
pragma solidity >=0.4.25 <0.9.0;

import "./Types.sol";
import "./Helpers.sol";

/**
 * @title Customers
 * @author Suresh Konakanchi
 * @dev Library for managing all customers, who are involved in the KYC process
 */
contract Customers {
    address[] internal customerList;
    mapping(address => Types.Customer) internal customers;

    // Events

    event CustomerAdded(address id_, string name, string email);
    event CustomerDataUpdated(address id_, string name, string email);
    event DataHashUpdated(address id_, string customerName, string dataHash);

    // Modifiers

    /**
     * @notice Checks whether customer already exists
     * @param id_ Metamask address of the customer
     */
    modifier isValidCustomer(address id_) {
        require(id_ != address(0), "Id is Empty");
        require(customers[id_].id_ != address(0), "User Id Empty");
        require(
            !Helpers.compareStrings(customers[id_].email, ""),
            "User Email Empty"
        );
        _;
    }

    // Support Functions

    /**
     * @notice Checks whether customer already exists
     * @param id_ Metamask address of the customer
     * @return exists_ boolean value to say if customer exists or not
     */
    function customerExists(address id_) internal view returns (bool exists_) {
        require(id_ != address(0), "Id is empty");
        if (
            customers[id_].id_ != address(0) &&
            !Helpers.compareStrings(customers[id_].email, "")
        ) {
            exists_ = true;
        }
    }

    // Contract Functions

    /**
     * @dev To get details of the customer
     * @param id_ Customer's metamask address
     * @return Customer object which will have complete details of the customer
     */
    function getcustomerdetails(address id_)
        internal
        view
        returns (Types.Customer memory)
    {
        return customers[id_];
    }

    /**
     * @dev Updates the user profile
     * @param name_ Customer name
     * @param email_ Email that need to be updated
     * @param mobile_ Mobile number that need to be updated
     */
    function updateprofile(
        string memory name_,
        string memory email_,
        uint256 mobile_
    ) internal {
        customers[msg.sender].name = name_;
        customers[msg.sender].email = email_;
        customers[msg.sender].mobileNumber = mobile_;
        emit CustomerDataUpdated(msg.sender, name_, email_);
    }

    /**
     * @dev Add new customer
     * @param customer_ Customer object
     */
    function addcustomer(Types.Customer memory customer_) internal {
        customers[customer_.id_] = customer_;
        customerList.push(customer_.id_);
        emit CustomerAdded(customer_.id_, customer_.name, customer_.email);
    }

    /**
     * @dev To Update KYC verification bank
     * @param id_ Customer's metamask ID
     */
    function updatekycdoneby(address id_) internal {
        require(id_ != address(0), "Customer Id Empty");
        customers[id_].kycVerifiedBy = msg.sender;
    }

    /**
     * @dev Updates the Datahash of the documents
     * @param hash_ Data hash value that need to be updated
     * @param currentTime_ Current Date Time in unix epoch timestamp
     */
    function updatedatahash(string memory hash_, uint256 currentTime_)
        internal
    {
        customers[msg.sender].dataHash = hash_;
        customers[msg.sender].dataUpdatedOn = currentTime_;
        emit DataHashUpdated(msg.sender, customers[msg.sender].name, hash_);
    }

    /**
     * @dev Search for customer details in the list that the bank is directly linked to
     * @param id_ Customer's metamask Id
     * @param customers_ Customer metamask Id's
     * @return boolean to say if customer exists or not
     * @return Customer object to get the complete details of the customer
     * Costly operation if we had more customers linked to this single bank
     */
    function searchcustomers(address id_, address[] memory customers_)
        internal
        view
        returns (bool, Types.Customer memory)
    {
        bool found_;
        Types.Customer memory customer_;

        for (uint256 i = 0; i < customers_.length; i++) {
            if (customers_[i] == id_) {
                found_ = true;
                customer_ = customers[id_];
                break;
            }
        }
        return (found_, customer_);
    }
}
"},"contracts/Helpers.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma experimental ABIEncoderV2;
pragma solidity >=0.4.25 <0.9.0;

/**
 * @title Helpers
 * @author Suresh Konakanchi
 * @dev Library for managing all the helper functions
 */
library Helpers {
    /**
     * @dev List of customers, who are linked to the current bank. Data will be sent in pages to avoid the more gas fee
     * @param pageNumber page number for which data is needed (1..2..3....n)
     * @param users_ User Id's who are linked to the requested bank
     * @return pages Total pages available
     * @return pageLength_ Length of the current page
     * @return startIndex_ Starting index of the current page
     * @return endIndex_ Ending index of the current page
     */
    function getIndexes(uint256 pageNumber, address[] memory users_)
        internal
        pure
        returns (
            uint256 pages,
            uint256 pageLength_,
            uint256 startIndex_,
            uint256 endIndex_
        )
    {
        uint256 reminder_ = users_.length % 25;
        pages = users_.length / 25;
        if (reminder_ > 0) pages++;

        pageLength_ = 25;
        startIndex_ = 25 * (pageNumber - 1);
        endIndex_ = 25 * pageNumber;

        if (pageNumber > pages) {
            // Page requested is not existing
            pageLength_ = 0;
            endIndex_ = 0;
        } else if (pageNumber == pages && reminder_ > 0) {
            // Last page where we don't had 25 records
            pageLength_ = reminder_;
            endIndex_ = users_.length;
        }
    }

    /**
     * @notice Internal function which doesn't alter any stage or read any data
     * Used to compare the string operations. Little costly in terms of gas fee
     * @param a string-1 that is to be compared
     * @param b string-2 that is to be compared
     * @return boolean value to say if both strings matched or not
     */
    function compareStrings(string memory a, string memory b)
        internal
        pure
        returns (bool)
    {
        return (keccak256(abi.encodePacked((a))) ==
            keccak256(abi.encodePacked((b))));
    }

    /**
     * @notice Internal function used to concatenate two addresses.
     * @param a address-1
     * @param b address-2 that needs to be appended
     * @return string value after concatenating
     */
    function append(address a, address b)
        internal
        pure
        returns (string memory)
    {
        return string(abi.encodePacked(a, b));
    }
}
"},"contracts/Types.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma experimental ABIEncoderV2;
pragma solidity >=0.4.25 <0.9.0;

library Types {
    enum Role {
        Admin, // 0
        Bank, // 1
        Customer // 2
    }

    enum BankStatus {
        Active, // 0
        Inactive // 1
    }

    enum KycStatus {
        Pending, // 0
        KYCVerified, // 1
        KYCFailed // 2
    }

    enum DataHashStatus {
        Pending, // 0
        Approved, // 1
        Rejected // 2
    }

    struct User {
        string name;
        string email;
        address id_;
        Role role;
        BankStatus status;
    }

    struct Customer {
        string name;
        string email;
        uint256 mobileNumber;
        address id_;
        address kycVerifiedBy; // Address of the bank only if KYC gets verified
        string dataHash; // Documents will be stored in decentralised storage & a hash will be created for the same
        uint256 dataUpdatedOn;
    }

    struct Bank {
        string name;
        string email;
        address id_;
        string ifscCode;
        uint16 kycCount; // How many KCY's did this bank completed so far
        BankStatus status; // RBI, we call "admin" here can disable the bank at any instance
    }

    struct KycRequest {
        string id_; // Combination of customer Id & bank is going to be unique
        address userId_;
        string customerName;
        address bankId_;
        string bankName;
        string dataHash;
        uint256 updatedOn;
        KycStatus status;
        DataHashStatus dataRequest; // Get approval from user to access the data
        string additionalNotes; // Notes that can be added if KYC verification fails  OR
        // if customer rejects the access & bank wants to re-request with some message
    }
}
